export function randomMaze(grid) {
    grid.map(row => {
        row.map(col => {
            if (!((col.col, col.row) == grid.startNode) || !((col.col, col.row) == grid.endNode)) {
                col.type = 1;
            }
        })
    })
}

function getRandomInt(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min) + min);
}

export default randomMaze
